import React from 'react';

const Sidebar = ({ onNavigate, onLogout, userRole }) => {
  const menuItems = [
    { page: 'dashboard', label: 'Painel', icon: <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-5 h-5 mr-3"><path d="M3 12L12 3L21 12M12 21V12"></path></svg> },
    { page: 'products', label: 'Produtos', icon: <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-5 h-5 mr-3"><circle cx="12" cy="12" r="10"></circle><path d="M12 8v4l3 3"></path></svg> },
    { page: 'clients', label: 'Clientes', icon: <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-5 h-5 mr-3"><path d="M16 21v-2a4 4 0 0 0-4-4H5a4 4 0 0 0-4 4v2"></path><circle cx="8.5" cy="7" r="4"></circle><path d="M20 8v6M23 11h-6"></path></svg> },
    { page: 'orders', label: 'Pedidos', icon: <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-5 h-5 mr-3"><path d="M14 2H6a2 2 0 0 0-2 2v16a2 2 0 0 0 2 2h12a2 2 0 0 0 2-2V8z"></path><polyline points="14 2 14 8 20 8"></polyline><line x1="16" y1="13" x2="8" y2="13"></line><line x1="16" y1="17" x2="8" y2="17"></line><polyline points="10 9 9 9 8 9"></polyline></svg> },
    { page: 'reports', label: 'Relatórios', icon: <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-5 h-5 mr-3"><rect x="9" y="9" width="13" height="13" rx="2" ry="2"></rect><path d="M5 15H4a2 2 0 0 1-2-2V4a2 2 0 0 1 2-2h9a2 2 0 0 1 2 2v1"></path></svg> },
  ];
  
  if (userRole === 'admin') {
    menuItems.splice(2, 0, { page: 'brands', label: 'Marcas', icon: <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-5 h-5 mr-3"><path d="M17 3H5a2 2 0 0 0-2 2v14a2 2 0 0 0 2 2h14a2 2 0 0 0 2-2V7z"></path><line x1="12" y1="18" x2="12" y2="10"></line><line x1="17" y1="18" x2="17" y2="14"></line><line x1="7" y1="18" x2="7" y2="12"></line></svg> });
  }

  return (
    <div className="w-64 bg-gray-900 text-gray-100 flex flex-col p-4 rounded-tr-3xl rounded-br-3xl shadow-xl">
      <div className="flex flex-col items-center mb-10">
        <svg width="60" height="60" viewBox="0 0 100 100" insert="src/public/BL" className="mb-2">
          <path fill="#5f56c7" d="M30 0h40L100 30v40L70 100H30L0 70V30z"/>
          <g fill="#fff" transform="translate(30, 25) scale(0.4)">
            <rect width="10" height="25" x="0" y="0" rx="2" ry="2"/>
            <rect width="10" height="25" x="15" y="0" rx="2" ry="2"/>
            <rect width="10" height="25" x="30" y="0" rx="2" ry="2"/>
          </g>
        </svg>
        <div className="text-2xl font-bold text-blue-400">Blum</div>
        <div className="text-xs text-gray-400">CURITIBA</div>
      </div>
      <nav className="flex-grow">
        <ul className="space-y-4">
          {menuItems.map(item => (
            <li key={item.page}>
              <button
                onClick={() => onNavigate(item.page)}
                className="w-full flex items-center p-3 rounded-xl transition-colors duration-200 hover:bg-gray-700 focus:outline-none focus:ring-2 focus:ring-purple-500"
              >
                {item.icon}
                {item.label}
              </button>
            </li>
          ))}
        </ul>
      </nav>
      <button 
        onClick={onLogout}
        className="w-full flex items-center justify-center p-3 mt-4 rounded-xl text-red-400 bg-gray-700 hover:bg-red-800 hover:text-white transition-colors duration-200 focus:outline-none focus:ring-2 focus:ring-red-500"
      >
        <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="w-5 h-5 mr-2"><path d="M9 21H5a2 2 0 0 1-2-2V5a2 2 0 0 1 2-2h4"></path><polyline points="16 17 21 12 16 7"></polyline><line x1="21" y1="12" x2="9" y2="12"></line></svg>
        Sair
      </button>
    </div>
  );
};

export default Sidebar;
